import React from "react";
import "./adduser.css"
const AddUser = () => {
  return (
    <div className="user-container">
      <form>
        <label for="name">Add Your Name</label>
        <input type="text" id="name" />
        <label for="age"> Age</label>
        <input type="number" id="age"/>
      </form>
    </div>
  );
};

export default AddUser;
